import React from "react";
import "./Finish.css";

function Finish() {
  return (
    <div className="finish">
      <Particle
        params={{
          particles: {
            number: {
              value: 50,
            },
            size: {
              value: 3,
            },
          },
          interactivity: {
            events: {
              onhover: {
                enable: true,
                mode: "repulse",
              },
            },
          },
        }}
      />
    </div>
  );
}

export default Finish;
